import React from 'react';
import './App.css';
import {BrowserRouter as Router, Link} from 'react-router-dom'; 
import {Container, Navbar,nav} from 'react-bootstrap';
//import navbar from './components/navbar';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state ={
      title:"Ntombizodwa Mafa",
      headerLinks:[
        {title:'Name', path: '/'},
        {title:'About', path: '/about'},
        {title:'Contact', path: '/contact'}
      ],
      home:{
        title:'Ntombizodzwa Mafa',
        subtitle:'Cirriculum Vatue',
        text: 'Check out my projects'
      },
      contact:{
        title:'Feel free to contact me'
      },
      about:{
        title:'About Me'
      }
    }
  }

  render(){
    return (
      <Router>
        <Container class="p-0"fluid={false}>
          <Navbar className="border-buttom">
            <Navbar.Brand>Ntombizodzwa Mafa</Navbar.Brand>
            <Navbar.Toggle aria-controls="navbar-toggle"/>
            <Navbar.Collapse id="navbar-toogle"/>

            <nav>
                <Link className="nav-link" to="/home"></Link>
            </nav>
          </Navbar>
        </Container>
      </Router>
    );
  }

}

export default App;
